nbind_success="Csökkentse a sikert";mcs_unbind_fail="Nem sikerült feloldani";mcs_unbind_tip="A szétválasztás után a felhő tárolása már nem tölt fel videókat, a korábbi tárolt videók automatikusan törlődnek a felhő tárolási szolgálati idő lejárta után.";mcs_no_buy_vbox="Nem vásárolt cloud storage szolgáltatást";mcs_have_active_code_input="Felhő tárolási aktiválási kód";mcs_input_active_code="Kérjük, adja meg az aktiválási kódot";mcs_active_now="aktiválás";mcs_active_fail="Az aktiválás sikertelen";mcs_active_success="Sikeresen aktiválva";mcs_renew_success="A megújulás sikeres";mcs_renew_fail="A megújítás nem sikerült";mcs_active_code_empty="Az aktiválási kód nem lehet üres";mcs_vbox_about="tovább";mcs_clean_data="Adatok törlése";mcs_clean_data_tip="Tiszta cloud storage adatok";mcs_vbox_id="Felhő tárolási azonosító";mcs_bind_device="Kapcsolódó felszerelések";mcs_vbox_invalid_date="A cloud storage lejárata";mcs_upload_info="Információ feltöltése";mcs_can_choose_vbox_use="Ön felhőfeltöltési szolgáltatást vásárolt, és a felhőfelhő egy része ingyenes, átválthat a használatára";mcs_change_vbox="kapcsoló";mcs_change_vbox_success="Sikeres átutalás";mcs_change_vbox_fail="Az átvitel sikertelen";mcs_vbox_instruction="Rövid bemutatkozás";mcs_vbox_instruction_text="A felhő tárolási funkció a kamera által kifejlesztett videó tárolási funkció, amely olyan technológiákon alapul, mint a mozgó objektumok észlelése. Amikor a fényképezőgép egy olyan mozgó eseményt észlel, mint például egy elmúlt személy vagy egy mozgó elem, akkor a kamera automatikusan rögzíti a videót, és nagy titkosítással feltölti a felhőbe, ugyanakkor hatékonyan megakadályozza az SD-kártyák megsemmisítése által okozott ember okozta megsemmisülést és a legfontosabb adatok elvesztését.";mcs_vbox_instruction_buy="Hogyan vásárolhat cloud storaget";mcs_vbox_instruction_buy_text="Válassza a Device (Eszköz) - [Beállítások] - [Cloud Storage] - [Cloud Storage engedélyezése] - [Buy cloud storage space] lehetőséget.";mcs_vbox_buy_tip_title="tippek:";mcs_vbox_buy_tip_text1="1) A felhő tárolási szolgáltatás nem támogatja a visszatérést sikeres vásárlás után, nem támogatja a visszatérítést";mcs_vbox_buy_tip_text2="2) A felhőfelhő tárolása csak a vásárlóhoz kötődik, a felhő tárolási szolgáltatással rendelkező eszköz törlődik, és új fiókot ad hozzá. Az új fiókban az eszköz nem élvezheti a felhő tárolási szolgáltatást.";mcs_how_calculate_service_time="Szolgáltatási időszámítás cloud storage után";mcs_calculate_describe="Ha a vásárlás sikeres és aktiválva van, felhőtároló használható, és elkezdjük kiszámítani a szervizidőt az aktiválási napra. Ha például 2017. április 13-án 7 napig vásárolt egy gördülő felhő-tároló szolgáltatást, és az aktiválási dátum 2017. április 14-én, akkor a szolgáltatás megszűnési ideje 2017. május 14., és a tárolás 2017. április 14-én kezdődik. 2017. április 20-án. 2017. április 21-én a 2017. április 14-i felhőfeltöltési videó automatikusan törlődik, és a 2017. április 15-től 2017. április 21-ig tartó felhő tárolási adatai megmaradnak, és a napi adatokat a jövőben egyenként meg fogják szüntetni.";mcs_vbox_instruction_renew="A felhő tárolásának megújítása";mcs_vbox_instruction_renew_text1="1) Ha a megvásárolt felhő tároló lejárt, akkor más típusú csomagszolgáltatásokat is megújíthat vagy vásárolhat. A vásárlás aktiválása után az új felhő tárolási csomag azonnal hatályba lép.";mcs_vbox_instruction_renew_text2="2) Ha a vásárolt felhő tárolási szolgáltatás nem járt le, ugyanazt a csomagot vásárolja (azonos típusú videofelvétel időtartama), és az új szolgáltatás meghosszabbítja a szervizidőt az eredeti szervizidőben.";mcs_vbox_instruction_renew_text3="3) Ha a megvásárolt felhőfeltöltési szolgáltatás nem járt le, és az új csomagszolgáltatásot le kívánja cserélni, akkor a különböző csomagcsere-szolgáltatások nem támogatottak. Meg kell oldania a felhőtárolót, mielőtt új cloud storage szolgáltatást vásárolhat. A tárolás normálisan használható.";mcs_vbox_instruction_reset="A kamera gyári alaphelyzetbe állítása";mcs_vbox_instruction_reset_text="Ha a fényképezőgép 10 másodpercig megnyomja a RESET gombot, és visszaállítja a gyári beállításokat, a kamera és a felhő tárolása le van kapcsolva.";mcs_vbox_unbind="A felhő tárolása megszünteti";mcs_vbox_unbind_text1="1) A felhő tárolása és a fényképezőgép kikapcsolása után a fényképezőgép videója már nem menthető el, és a tárolt videó automatikusan törlődik a szolgálati idő lejártát követően.";mcs_vbox_unbind_text2="2) A szétválasztás után a felhő tárolása más kamerákhoz köthető. Más kamerák csatlakoztatása után a korábban tárolt videó törlésre kerül a következő ciklus rögzítése során Ha egy gördülő felhő tároló szolgáltatást vásárolt 7 napig, akkor a felhő tárolása az A kamerához kötődik és a B kamerához kötődik. A tárolt hétnapos videó automatikusan törlődik a hurokfelvétel nyolcadik napján. A felhő tárolási szolgáltatás típusa és a lejárati idő változatlan.";mcs_vbox_choose="Válassza ki a felhő tárolását";mcs_vbox_choose_text1="Válassza a Device (Eszköz) - [Settings] (Beállítások) - [Cloud Storage] - [Cloud Storage engedélyezése] - [Select Cloud Storage] lehetőséget";mcs_vbox_choose_text2="Amikor megvásárolta az eszközt, és megvásárolta a felhő tárolását is, az eszköz valamilyen okból visszatért (Megjegyzés: Miután a felhő tárolási szolgáltatás megvásárolta, nem támogatja a visszatérést, visszatérítés nem támogatott.) Leállíthatja az eszközt és a felhő tárolását. A Cloud Storage csatlakozik az új eszközhöz.";mcs_vbox_choose_tip_text1="1) A felhő tárolására és fiókkötésére csak ugyanazt a fiókot lehet használni. A feloldatlan felhő tárolóeszközt és a kötött felhő tárolóeszközt ugyanarra a fiókra kell helyezni.";mcs_vbox_choose_tip_text2="2) A felhő tárolási lehetőségei csak akkor használhatók, ha szabad felhő tárhely van.";mcs_input_pwd="Kérjük, adja meg jelszavát";mcs_bind_fail="Az eszközkapcsolat meghiúsult";mcs_pwd_empty="A jelszó nem lehet üres";mcs_set_pwd_success="Jelszó sikerének beállítása";